import React from "react";
import "./InformatiqueSection.css";

const InformatiqueSection = () => {
  return (
    <section id="informatique" className="section informatique">
      <h2>Informatique</h2>
      <p>Apprenez la programmation et l'univers du web.</p>
    </section>
  );
};

export default InformatiqueSection;
